import React, { Component } from "react";
import Button, {Layout} from '@material-ui/core/Button';
import { Grid } from "@material-ui/core";

export default class extends Component {
  render() {
    return (
    <Layout>
      <head>
        {t('is the head of page')}
      </head>
    </Layout>
    )
  }

}
